import React from 'react';
import { Container } from 'react-bootstrap';

const Home = () => (
  <Container className="mt-5">
    <h1>Welcome to Yegna Trading App</h1>
    <p>Manage your rebar sales, purchases, and store balances efficiently.</p>
  </Container>
);

export default Home;
